package edu.technopolis;

import java.math.BigInteger;

/**
 * Это класс с тестами для проверки работоспособности кода домашнего задания.
 *
 */
public class Test {

    private static final String FIB_300_K =
            "";

    private static final String f10k =
            "";

    public static void main(String[] args) {
        FibonacciAlgorithm algorithm = new RealFibonacciAlgorithm();
        checkThat("1".equals(algorithm.evaluate(1)), "Incorrect value for 1");
        checkThat("1".equals(algorithm.evaluate(2)), "Incorrect value for 2");
        checkThat("2".equals(algorithm.evaluate(3)), "Incorrect value for 3");
        checkThat("3".equals(algorithm.evaluate(4)), "Incorrect value for 4");
        checkThat("5".equals(algorithm.evaluate(5)), "Incorrect value for 5");
        checkThat("354224848179261915075".equals(algorithm.evaluate(100)), "Incorrect value for 100");
        checkThat(FIB_300_K.equals(algorithm.evaluate(300000)), "Incorrect value for 3000000");
        // add test from Wolfram
        checkThat(f10k.equals(algorithm.evaluate(10000)), "Incorrect value for 3000000");
        System.out.println("SUCCESS!");
    }

    private static void checkThat(boolean check, String message) {
        if (!check) {
            System.err.println(message);
            System.exit(1);
        }
    }
}
